   <script>  
      // Usage
      'use strict';
      // jQuery noConflict declaration
      jQuery.noConflict();
      // run jQuery
      jQuery(document).ready(function( $ ){
         $('a[href^="#"]').on('click', function(event) {
            var target = $(this.getAttribute('href'));
            if( target.length ) {
               event.preventDefault();
               $('html, body').stop().animate({
                  scrollTop: target.offset().top-70
               }, 1000);
            }
         });
         $('.nav-menu a[href^="#"]').on('click', function(event) {         
            const vw = Math.max(document.documentElement.clientWidth || 0, window.innerWidth || 0);
            if(vw<993){            
               $('.nav-toggle').toggleClass('active');
               $('.nav-menu').toggleClass('active');
            }
         });      
         $('.nav-toggle').click(function(e){
            e.preventDefault();
            $('.nav-toggle').toggleClass('active');
            $('.nav-menu').toggleClass('active');
            $('.nav-overlay').toggleClass('active');
         })
         $('.nav-overlay').click(function(e){
            e.preventDefault();
            $('.nav-toggle').toggleClass('active');
            $('.nav-menu').toggleClass('active');
            $('.nav-overlay').toggleClass('active');
         })
         $(".center").slick({
            mobileFirst:true,
            responsive: [
               {breakpoint: 1280, settings: {slidesToShow: 5}},
               {breakpoint: 996,  settings: {slidesToShow: 4}},
               {breakpoint: 800,  settings: {slidesToShow: 3}},
               {breakpoint: 590,  settings: {slidesToShow: 2}},
               {breakpoint: 200,  settings: {slidesToShow: 1}}
            ],
            autoplay:true,
            autoplaySpeed: 3000,
            dots: true,
            infinite: true,
            centerMode: true,
            slidesToShow: 5,
            slidesToScroll: 3,
            dots: false
         });
         $('.rbutton').click(function(e){
            var x = $(this).parent().siblings('.parent');
            $(x).animate({"scrollLeft": $(x).scrollLeft() + 250});
         });
         $('.lbutton').click(function(e){
            var x = $(this).parent().siblings('.parent');
            $(x).animate({"scrollLeft": $(x).scrollLeft() - 250});
         });
         $('#scrolltop').click(function(e){
            window.scrollTo({top: 0, behavior: 'smooth'});
         });
         $('.venobox').venobox({infinigall:	true});
         $('.mediPlayer').mediaPlayer();
      });
      AOS.init({once: true});   
   </script>

   </body>
